import React from 'react'
import { useAddTypeMutation } from '../../redux/api/server.api'
import './modalAddType.scss'

interface modalProps{
    setAddTypeModal:(togle:boolean)=>void,
}



export default function ModalAddType({setAddTypeModal}:modalProps) {
  const [name,setName] = React.useState<string>('')
  const [img,setImg] = React.useState<any>('')
  const [addType] = useAddTypeMutation()

 


  return (
    <div className='modal' onClick={()=>setAddTypeModal(false)}>
      <div onClick={(e:React.MouseEvent)=>e.stopPropagation()} className='modal_content'>
      <input className='modal_input' placeholder='Введите название типа'></input>
      <input type="file" onChange={(e:React.ChangeEvent<any>)=>setImg(e.target.files[0])} placeholder='Введите название типа'></input>
      <input type='submit' className='submit' ></input>
      </div>
    </div>
  )
}
